import React, { useEffect, useState } from "react";
import { Col, Container, Row, Table } from "react-bootstrap";

export default function Home() {

    const [ list, setList ] = useState([]);

    const Api_Url = "https://api.punkapi.com/v2/beers";

    const pageNumber = 2;
    const perPage = 10;


    useEffect(() =>{
        fetch('https://api.punkapi.com/v2/beers/')
        .then(res => res.json())
        .then(data =>  console.log("data", data));
    }, []);

    const paginateParams = () => {
        fetch('https://api.punkapi.com/v2/beers/?page='+pageNumber+'&per_page='+perPage)
        .then(res => res.json())
        .then(data =>  {
            console.log("data", data.Array);
            setList(data.Array);
        });
    }

    console.log('list', list);

    return(
        <div>
            <Container>
                <Row>
                    <Col>
                        <h2>Home</h2>
                        <h1>
                        {
                            list.map( item =>(
                                <p>{item.id}</p>
                                )
                            )
                        }
                        </h1>
                        <Table responsive>
                            <thead>
                                <tr>
                                <th>Id</th>
                                <th>name</th>
                                <th>tagline</th>
                                <th>first_brewed</th>
                                <th>description</th>
                                <th>image_url</th>
                                <th>abv</th>
                                <th>ibu</th>
                                <th>target_fg</th>
                                <th>target_og</th>
                                <th>ebc</th>
                                <th>srm</th>
                                <th>ph</th>
                                <th>attenuation_level</th>
                                <th>volume</th>
                                <th>boil_volume</th>
                                <th>mash_temp</th>
                                <th>mash_temp duration</th>
                                <th>fermentation</th>
                                <th>twist</th>
                                <th>ingredients malt</th>
                                <th>hops</th>
                                <th>yeast</th>
                                <th>food_pairing</th>
                                <th>brewers_tips</th>
                                <th>contributed_by</th>
                                </tr>
                            </thead>
                            <tbody>
                                {
                                    list.length > 0 ?

                                    list.map( (items, index) => (
                                        <tr key={index}>
                                            <td>{items.id}</td>
                                            <td>{items.name}</td>
                                        </tr>
                                    ))

                                    :

                                    <p>No</p>
                                }
                                <tr>
                                    <td></td>
                                </tr>
                            </tbody>
                        </Table>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}
